// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import React from "react";
import Paper from '@mui/material/Paper';
// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import Footer from "examples/Footer";
import {useState} from 'react';
import Stack from '@mui/material/Stack';
// Data
import MDButton from "components/MDButton";
//modal
import TextField from '@mui/material/TextField';
import { Autocomplete } from "@mui/material";
import { useNavigate } from 'react-router-dom';
import { styled } from '@mui/material/styles';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';

function Test() {
    const [test, setTest] = React.useState('');
    const Item = styled(Paper)(({ theme }) => ({
        backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
        ...theme.typography.body2,
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
      }));
      const handleChange = (event) => {
        setTest(event.target.value);
      };


  const [open, setOpen] = useState(false);
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);
  const navigate = useNavigate();

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };
  const handleButtonClick = () => {
    // Navigate to the next page when the button is clicked
    navigate('/DrData');
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };


  return (
    <DashboardLayout>
      <MDBox pt={6} pb={3}>
        <Grid container spacing={6}>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
                display="flex"
                justifyContent="space-between" // To space elements evenly
                alignItems="center" // Align items vertically
              >
                <MDTypography variant="h6" color="white">
                  CREATE TEST
                </MDTypography>
              </MDBox>
              <MDBox pt={3}>
              <MDBox>
                <Stack spacing={2}alignItems="center" sx={{marginTop:'20px'}}>
                <TextField id="outlined-basic" label="Test Name" variant="outlined" sx={{width:'40%'}} />
                <Select
                  label="Test Name"
                  variant="outlined"
                  sx={{ width: '40%',height:'0px' }}
                >
                  <MenuItem value="">None</MenuItem>
                  <MenuItem value={10}>Option 1</MenuItem>
                  <MenuItem value={20}>Option 2</MenuItem>
                  <MenuItem value={30}>Option 3</MenuItem>
                </Select>
                <Item>Item 3</Item>
                </Stack>
                </MDBox>
              </MDBox>
            </Card>

          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Test;
